function canvasTest() {
    'use strict';

    describe("cl.Canvas", function () {

        var canvas = null;

        before(function () {

        });

        it('should create canvas object', function() {
            canvas = new cl.Canvas(320, 240);
            assert.ok(canvas);
        });

        it('should exists context 2d', function() {
            assert.ok(canvas.ctx);
        });

        it('should exists DOM element', function() {
            assert.ok(canvas.el);
        });

        it('should have dimensions', function() {
            should.equal(canvas.el.width, 320, "Wrong canvas width");
            should.equal(canvas.el.height, 240, "Wrong canvas height");
        });

        it('should resize', function() {
            canvas.resize(300, 200);
            should.equal(canvas.el.width, 300, "Wrong canvas width");
            should.equal(canvas.el.height, 200, "Wrong canvas height");
        });

        it('should set line style', function() {
            canvas.setLineStyle(2, "#AAFFEE");
        });

        it('should set fill color', function() {
            canvas.setFillColor("#4488FF");
        });

        it('should set alpha', function() {
            canvas.setAlpha(0.8);
            expect(canvas.ctx.globalAlpha.toFixed(1)).equal("0.8");
        });

        it('should draw lines', function() {
            for (var x = 0; x < 300; x+=4) canvas.drawLine(x, 0, x, 200)
            canvas.setLineStyle(1, "#FF22CC");
            for (var y = 0; y < 200; y+= 6) canvas.drawLine(0, y, 300, y);

            var ref = new Image();
            ref.src = "data:image/png;base64,";

            expect(imagediff.equal(canvas.el, ref, 300)).equal(true, "Should be equal to reference image");

            ref = null;
        });

        it('should clear', function() {
            canvas.clear();

            var ref = new Image();
            ref.src = "data:image/png;base64,";

            expect(imagediff.equal(canvas.el, ref, 0)).equal(true, "Should be equal to reference image");

            ref = null;
        });

        it('should draw arrows', function() {
            canvas.setFillColor("#2288FF");
            for (var x = 0; x < 300; x+=20) {
                for (var y = 0; y < 200; y += 20) {
                    canvas.drawArrow(x, y, x+y, Math.floor(x / 10), Math.cos(x+y));
                }
            }

            var ref = new Image();
            ref.src = "data:image/png;base64,";

            expect(imagediff.equal(canvas.el, ref, 300)).equal(true, "Should be equal to reference image");

            ref = null;
        });


        it('should draw text', function() {
            canvas.clear();
            canvas.setFillColor("#AA2211");
            for (var x = 0; x < 300; x+=50) {
                for (var y = 0; y < 200; y += 14) {
                    canvas.drawText(x+y, x, y, 4 + Math.floor(x / 15), "center", "middle", "Arial", "bold italic");
                }
            }

            var ref = new Image();
            ref.src = "data:image/png;base64,";

            expect(imagediff.equal(canvas.el, ref, 300)).equal(true, "Should be equal to reference image");

            ref = null;
        });

        it('should draw on another canvas', function() {
            var tmp = new cl.Canvas(canvas.width, canvas.height);
            tmp.draw(canvas, 0, 0);

            expect(imagediff.equal(canvas.el, tmp.el, 0)).equal(true, "Should be equal to image on another canvas");

            tmp.destroy();
        });

    });

}
